import React from 'react';
import { PieChart, PieArcSeries } from 'reaviz'; // to download library, in terminal enter: "npm i reaviz"

const getChartData = (percentage, type1, type2, mbtiType) => {
  const isType1Dominant = mbtiType && mbtiType.includes(type1);
  const dominantType = isType1Dominant && type1 || type2;
  const nonDominantType = isType1Dominant && type2 || type1;
  return [
    { key: dominantType, data: percentage },
    { key: nonDominantType, data: 100 - percentage }
  ];
};


const CompatabilityCharts = ({ mbtiData, mbtiType }) => {
  const dataEI = getChartData(mbtiData.EI || 0, 'E', 'I', mbtiType);
  const dataSN = getChartData(mbtiData.SN || 0, 'S', 'N', mbtiType);
  const dataTF = getChartData(mbtiData.TF || 0, 'T', 'F', mbtiType);
  const dataJP = getChartData(mbtiData.JP || 0, 'J', 'P', mbtiType);

  return (
    <div className="chart-container" id="comp">
      <div className="charttop" id="comp">
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={dataEI}
            series={<PieArcSeries colorScheme={['#E5E8B6', '#F6DC8D']} />}
          />
        </div>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={dataSN}
            series={<PieArcSeries colorScheme={['#BEB8EB', '#022B3A']} />}
          />
        </div>
      </div>
      <div className="chartbottom" id="comp">
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={dataTF}
            series={<PieArcSeries colorScheme={['#E3EEE2', '#ACD1E9']} />}
          />
        </div>
        <div className="chart-wrap" id="comp">
          <PieChart
            width={250}
            height={250}
            data={dataJP}
            series={<PieArcSeries colorScheme={['#F49A9A91', '#E0E0E2']} />}
          />
        </div>
      </div>
    </div>
  );
};

function Compatability({ profile }) {
  const { mbtiData, mbti } = profile;

  return (
    <div className="mainmbti">
      <header>
        <h1 className="compheader">{profile.name}'s Assessment</h1>
      </header>
      <div className="mbtibody">
        <CompatabilityCharts mbtiData={mbtiData} mbtiType={mbti} />
      </div>
      <div className="compdesc">
        {<Assessment title={mbtiData.EI || 0} kind={mbti && mbti[0] === 'E' && 'Extraverted' || 'Introverted'} nonDominant={mbti && mbti[0] === 'E' && 'Introverted' || 'Extraverted'} />}
        {<Assessment title={mbtiData.SN || 0} kind={mbti && mbti[1] === 'S' && 'Observant' || 'Intuitive'} nonDominant={mbti && mbti[1] === 'S' && 'Intuitive' || 'Observant'} />}
        {<Assessment title={mbtiData.TF || 0} kind={mbti && mbti[2] === 'T' && 'Thinking' || 'Feeling'} nonDominant={mbti && mbti[2] === 'T' && 'Feeling' || 'Thinking'} />}
        {<Assessment title={mbtiData.JP || 0} kind={mbti && mbti[3] === 'J' && 'Judging' || 'Prospecting'} nonDominant={mbti && mbti[3] === 'J' && 'Prospecting' || 'Judging'} />}
      </div>

    </div>
  );
}

function Assessment({ title, kind, nonDominant }) {
  const percentage = title;
  const kindId = kind.substring(0, 4).toLowerCase();

  return (
    <div className="assessment-container">
      <div className={`desc`} id={kindId}>
        <p>
          You are <b>{percentage}%</b> more <b><em>{kind}</em></b> than {nonDominant}.
        </p>
      </div>
    </div>
  );
}


export { Compatability };
